selector_to_html = {"a[href=\"#yaml-stringify\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">YAML.stringify<a class=\"headerlink\" href=\"#yaml-stringify\" title=\"Link to this heading\">#</a></h2><p>Browser testing provided by:</p>", "a[href=\"#yaml\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">YAML <a href=\"https://www.npmjs.com/package/yaml\"><img alt=\"https://badge.fury.io/js/yaml.svg\" class=\"align-right\" loading=\"lazy\" src=\"https://badge.fury.io/js/yaml.svg\"/></a><a class=\"headerlink\" href=\"#yaml\" title=\"Link to this heading\">#</a></h1><p><code class=\"docutils literal notranslate\"><span class=\"pre\">yaml</span></code> is a definitive library for <a class=\"tippyAnchor reference external\" href=\"https://yaml.org/\">YAML</a>, the human friendly data serialization standard.\nThis library:</p>", "a[href=\"#api-overview\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">API Overview<a class=\"headerlink\" href=\"#api-overview\" title=\"Link to this heading\">#</a></h2><p>The API provided by <code class=\"docutils literal notranslate\"><span class=\"pre\">yaml</span></code> has three layers, depending on how deep you need to go: <a class=\"tippyAnchor reference external\" href=\"https://eemeli.org/yaml/#parse-amp-stringify\">Parse &amp; Stringify</a>, <a class=\"tippyAnchor reference external\" href=\"https://eemeli.org/yaml/#documents\">Documents</a>, and the underlying <a class=\"tippyAnchor reference external\" href=\"https://eemeli.org/yaml/#parsing-yaml\">Lexer/Parser/Composer</a>.\nThe first has the simplest API and \u201cjust works\u201d, the second gets you all the bells and whistles supported by the library along with a decent <a class=\"tippyAnchor reference external\" href=\"https://eemeli.org/yaml/#content-nodes\">AST</a>, and the third lets you get progressively closer to YAML source, if that\u2019s your thing.</p><p>A <a class=\"tippyAnchor reference external\" href=\"https://eemeli.org/yaml/#command-line-tool\">command-line tool</a> is also included.</p>", "a[href=\"#parse-stringify\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Parse &amp; Stringify<a class=\"headerlink\" href=\"#parse-stringify\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#yaml-parse\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">YAML.parse<a class=\"headerlink\" href=\"#yaml-parse\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#documents\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Documents<a class=\"headerlink\" href=\"#documents\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#parsing-yaml\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Parsing YAML<a class=\"headerlink\" href=\"#parsing-yaml\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#content-nodes\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Content Nodes<a class=\"headerlink\" href=\"#content-nodes\" title=\"Link to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
